import React from 'react';

function UploadBlogPage() {
  return (
    <div>
      <form className='w-3/4 mx-auto'>
        <label className='text-3xl'>Title</label>
        <input className='border border-gray-200 shadow w-full text-xl' />
      </form>
    </div>
  );
}

export default UploadBlogPage;
